ditions/resource-policies).", "format": "int32", "type": "integer" } } }, "Modification": { "properties": { "create": { "description": "Create a new column family with the specified schema, or fail if one already exists with the given ID.", "$ref": "ColumnFamily" }, "update": { "$ref": "ColumnFamily", "description": "Update an existing column family to the specified schema, or fail if no column family exists with the given ID." }, "id": { "type": "string", "description": "The ID of the column family to be modified." }, "drop": { "type": "boolean", "description": "Drop (delete) the column family with the given ID, or fail if no such family exists." } }, "id": "Modification", "type": "object", "description": "A create, update, or delete of a particular column family." }, "Backup": { "type": "object", "id": "Backup", "description": "A backup of a Cloud Bigtable table.", "properties": { "endTime": { "format": "google-datetime", "description": "Output only. `end_time` is the time that the backup was finished. The row data in the backup will be no newer than this timestamp.", "type": "string", "readOnly": true }, "expireTime": { "format": "google-datetime", "type": "string", "description": "Required. The expiration time of the backup, with microseconds granularity that must be at least 6 hours and at most 30 days from the time the request is received. Once the `expire_time` has passed, Cloud Bigtable will delete the backup and free the resources used by the backup." }, "name": { "description": "A globally unique identifier for the backup which cannot be changed. Values are of the form `projects/{project}/instances/{instance}/clusters/{cluster}/ backups/_a-zA-Z0-9*` The final segment of the name must be between 1 and 50 characters in length. The backup is stored in the cluster identified by the prefix of the backup name of the form `projects/{project}/instances/{instance}/clusters/{cluster}`.", "type": "string" }, "state": { "readOnly": true, "description": "Output only. T