is cluster. If the encryption key protecting this resource is customer managed, then its version can be rotated in Cloud Key Management Service (Cloud KMS). The primary version of the key and its status will be reflected here when changes propagate from Cloud KMS.", "type": "array", "readOnly": true }, "replicationState": { "readOnly": true, "type": "string", "description": "Output only. The state of replication for the table in this cluster.", "enum": [ "STATE_NOT_KNOWN", "INITIALIZING", "PLANNED_MAINTENANCE", "UNPLANNED_MAINTENANCE", "READY", "READY_OPTIMIZING" ], "enumDescriptions": [ "The replication state of the table is unknown in this cluster.", "The cluster was recently created, and the table must finish copying over pre-existing data from other clusters before it can begin receiving live replication updates and serving Data API requests.", "The table is temporarily unable to serve Data API requests from this cluster due to planned internal maintenance.", "The table is temporarily unable to serve Data API requests from this cluster due to unplanned or emergency maintenance.", "The table can serve Data API requests from this cluster. Depending on replication delay, reads may not immediately reflect the state of the table in other clusters.", "The table is fully created and ready for use after a restore, and is being optimized for performance. When optimizations are complete, the table will transition to `READY` state." ] } }, "id": "ClusterState", "description": "The state of a table's data in a particular cluster." }, "ClusterConfig": { "type": "object", "properties": { "clusterAutoscalingConfig": { "description": "Autoscaling configuration for this cluster.", "$ref": "ClusterAutoscalingConfig" } }, "description": "Configuration for a cluster.", "id": "ClusterConfig" }, "ListHotTabletsResponse": { "description": "Response message for BigtableInstanceAdmin.ListHotTablets.", "id": "ListHotTabletsResponse", "type": "object", "properties": { "hotTablets": { "typ