ion": "Properties of the object. Contains field @type with type URL.", "type": "any" } }, "locationId": { "type": "string", "description": "The canonical id for this location. For example: `\"us-east1\"`." }, "labels": { "additionalProperties": { "type": "string" }, "type": "object", "description": "Cross-service attributes for the location. For example {\"cloud.googleapis.com/region\": \"us-east1\"}" }, "name": { "description": "Resource name for the location, which may vary between implementations. For example: `\"projects/example-project/locations/us-east1\"`", "type": "string" } }, "type": "object", "id": "Location", "description": "A resource that represents Google Cloud Platform location." }, "UndeleteTableMetadata": { "id": "UndeleteTableMetadata", "type": "object", "description": "Metadata type for the operation returned by google.bigtable.admin.v2.BigtableTableAdmin.UndeleteTable.", "properties": { "name": { "type": "string", "description": "The name of the table being restored." }, "endTime": { "type": "string", "description": "If set, the time at which this operation finished or was cancelled.", "format": "google-datetime" }, "startTime": { "type": "string", "description": "The time at which this operation started.", "format": "google-datetime" } } }, "AutoscalingTargets": { "properties": { "cpuUtilizationPercent": { "description": "The cpu utilization that the Autoscaler should be trying to achieve. This number is on a scale from 0 (no utilization) to 100 (total utilization), and is limited between 10 and 80, otherwise it will return INVALID_ARGUMENT error.", "format": "int32", "type": "integer" }, "storageUtilizationGibPerNode": { "description": "The storage utilization that the Autoscaler should be trying to achieve. This number is limited between 2560 (2.5TiB) and 5120 (5TiB) for a SSD cluster and between 8192 (8TiB) and 16384 (16TiB) for an HDD cluster, otherwise it will return INVALID_ARGUMENT error. If this value is set to 0, it will be treated as if it were set to the default value: 2560 for SSD, 8192 for HDD.", "type": "integer", "format": "int32" } }, "type": "object", "id": "AutoscalingTargets", "description": "The Autoscaling targets for a Cluster. These determine the recommended nodes." }, "PartialUpdateClusterMetadata": { "properties": { "requestTime": { "description": "The time at which the original request was received.", "format": "google-datetime", "type": "string" }, "finishTime": { "type": "string", "description": "The time at which the operation failed or was completed successfully.", "format": "google-datetime" }, "originalRequest": { "description": "The original request for PartialUpdateCluster.", "$ref": "PartialUpdateClusterRequest" } }, "id": "PartialUpdateClusterMetadata", "description": "The metadata for the Operation returned by PartialUpdateCluster.", "type": "object" }, "ListTablesResponse": { "description": "Response message for google.bigtable.admin.v2.BigtableTableAdmin.ListTables", "id": "ListTablesResponse", "properties": { "tables": { "items": { "$ref": "Table" }, "type": "array", "description": "The tables present in the requested instance." }, "nextPageToken": { "type": "string", "description": "Set if not all tables could be returned in a single response. Pass this value to `page_token` in another request to get the next page of results." } }, "type": "object" }, "OptimizeRestoredTableMetadata": { "properties": { "progress": { "description": "The progress of the post-restore optimizations.", "$ref": "OperationProgress" }, "name": { "type": "string", "description": "Name of the restored table being optimized." } }, "type": "object", "description": "Metadata type for the long-running operation used to track the progress of optimizations performed on a newly restored table. This long-running operation is automatically created by the system after the successful completion of a table restore, and cannot be cancelled.", "id": "OptimizeRestoredTableMetadata" }, "HotTablet": { "properties": { "name": { "type": "string", "description": "The unique name of the hot tablet. Values are of the form `projects/{project}/instances/{instance}/clusters/{cluster}/hotTablets/[a-zA-Z0-9_-]*`." }, "tableName": { "type": "string", "description": "Name of the table that contains the tablet. Values are of the form `projects/{project}/instances/{instance}/tables/_a-zA-Z0-9*`." }, "nodeCpuUsagePercent": { "format": "float", "type": "number", "readOnly": true, "description": "Output only. The average CPU usage spent by a node on this tablet over the start_time to end_time time range. The percentage is the amount of CPU used by the node to serve the tablet, from 0% (tablet was not interacted with) to 100% (the node spent all cycles serving the hot tablet)." }, "endKey": { "description": "Tablet End Key (inclusive).", "type": "string" }, "startKey": { "type": "string", "description": "Tablet Start Key (inclusive)." }, "endTime": { "description": "Output only. The end time of the hot tablet.", "type": "string", "format": "google-datetime", "readOnly": true }, "startTime": { "readOnly": true, "description": "Output only. The start time of the hot tablet.", "type": "string", "format": "google-datetime" } }, "description": "A tablet is a defined by a start and end key and is explained in https://cloud.google.com/bigtable/docs/overview#architecture and https://cloud.google.com/bigtable/docs/performance#optimization. A Hot tablet is a tablet that exhibits high average cpu usage during the time interval from start time to end time.", "type": "object", "id": "HotTablet" }, "CreateBackupMetadata": { "properties": { "endTime": { "format": "google-datetime", "type": "string", "description": "If set, the time at which this operation finished or was cancelled." }, "name": { "description": "The name of the backup being created.", "type": "string" }, "startTime": { "description": "The time at which this operation started.", "format": "google-datetime", "type": "string" }, "sourceTable": { "description": "The name of the table the backup is created from.", "type": "string" } }, "description": "Metadata type for the operation returned by CreateBackup.", "type": "object", "id": "CreateBackupMetadata" }, "GenerateConsistencyTokenRequest": { "properties": {}, "description": "Request message for google.bigtable.admin.v2.BigtableTableAdmin.GenerateConsistencyToken", "type": "object", "id": "GenerateConsistencyTokenRequest" }, "TestIamPermissionsResponse": { "description": "Response message for `TestIamPermissions` method.", "type": "object", "id": "TestIamPermissionsResponse", "properties": { "permissions": { "description": "A subset of `TestPermissionsRequest.permissions` that the caller is allowed.", "items": { "type": "string" }, "type": "array" } } }, "GetIamPolicyRequest": { "description": "Request message for `GetIamPolicy` method.", "properties": { "options": { "description": "OPTIONAL: A `GetPolicyOptions` object for specifying options to `GetIamPolicy`.", "$ref": "GetPolicyOptions" } }, "id": "GetIamPolicyRequest", "type": "object" }, "EncryptionConfig": { "id": "EncryptionConfig", "properties": { "kmsKeyName": { "type": "string", "description": "Describes the Cloud KMS encryption key that will be used to protect the destination Bigtable cluster. The requirements for this key are: 1) The Cloud Bigtable service account associated with the project that contains this cluster must be granted the `cloudkms.cryptoKeyEncrypterDecrypter` role on the CMEK key. 2) Only regional keys can be used and the region of the CMEK key must match the region of the cluster. Values are of the form `projects/{project}/locations/{location}/keyRings/{keyring}/cryptoKeys/{key}`" } }, "type": "object", "description": "Cloud Key Management Service (Cloud KMS) settings for a CMEK-protected cluster." }, "BackupInfo": { "type": "object", "id": "BackupInfo", "properties": { "sourceTable": { "type": "string", "readOnly": true, "description": "Output only. Name of the table the backup was created from." }, "startTime": { "type": "string", "readOnly": true, "description": "Output only. The time that the backup was started. Row data in the backup will be no older than this timestamp.", "format": "google-datetime" }, "endTime": { "type": "string", "format": "google-datetime", "readOnly": true, "description": "Output only. This time that the backup was finished. Row data in the backup will be no newer than this timestamp." }, "backup": { "description": "Output only. Name of the backup.", "type": "string", "readOnly": true } }, "description": "Information about a backup." }, "EncryptionInfo": { "type": "object", "properties": { "kmsKeyVersion": { "type": "string", "readOnly": true, "description": "Output only. The version of the Cloud KMS key specified in the parent cluster that is in use for the data underlying this table." }, "encryptionType": { "readOnly": true, "type": "string", "description": "Output only. The type of encryption used to protect this resource.", "enum": [ "ENCRYPTION_TYPE_UNSPECIFIED", "GOOGLE_DEFAULT_ENCRYPTION", "CUSTOMER_MANAGED_ENCRYPTION" ], "enumDescriptions": [ "Encryption type was not specified, though data at rest remains encrypted.", "The data backing this resource is encrypted at rest with a key that is fully managed by Google. No key version or status will be populated. This is the default state.", "The data backing this resource is encrypted at rest with a key that is managed by the customer. The in-use version of the key and its status are populated for CMEK-protected tables. CMEK-protected backups are pinned to the key version that was in use at the time the backup was taken. This key version is populated but its status is not tracked and is reported as `UNKNOWN`." ] }, "encryptionStatus": { "$ref": "Status", "readOnly": true, "description": "Output only. The status of encrypt/decrypt calls on underlying data for this resource. Regardless of status, the existing data is always encrypted at rest." } }, "id": "EncryptionInfo", "description": "Encryption information for a given resource. If this resource is protected with customer managed encryption, the in-use Cloud Key Management Service (Cloud KMS) key version is specified along with its status." }, "TestIamPermissionsRequest": { "id": "TestIamPermissionsRequest", "description": "Request message for `TestIamPermissions` method.", "properties": { "permissions": { "type": "array", "items": { "type": "string" }, "description": "The set of permissions to check for the `resource`. Permissions with wildcards (such as `*` or `storage.*`) are not allowed. For more information see [IAM Overview](https://cloud.google.com/iam/docs/overview#permissions)." } }, "type": "object" }, "AuditConfig": { "properties": { "auditLogConfigs": { "type": "array", "description": "The configuration for logging of each type of permission.", "items": { "$ref": "AuditLogConfig" } }, "service": { "description": "Specifies a service that will be enabled for audit logging. For example, `storage.googleapis.com`, `cloudsql.googleapis.com`. `allServices` is a special value that covers all services.", "type": "string" } }, "id": "AuditConfig", "type": "object", "description": "Specifies the audit configuration for a service. The configuration determines which permission types are logged, and what identities, if any, are exempted from logging. An AuditConfig must have one or more AuditLogConfigs. If there are AuditConfigs for both `allServices` and a specific service, the union of the two AuditConfigs is used for that service: the log_types specified in each AuditConfig are enabled, and the exempted_members in each AuditLogConfig are exempted. Example Policy with multiple AuditConfigs: { \"audit_configs\": [ { \"service\": \"allServices\", \"audit_log_configs\": [ { \"log_type\": \"DATA_READ\", \"exempted_members\": [ \"user:jose@example.com\" ] }, { \"log_type\": \"DATA_WRITE\" }, { \"log_type\": \"ADMIN_READ\" } ] }, { \"service\": \"sampleservice.googl